import React from 'react';
import backgroundImage from './result.png'; // Adjust path as necessary

function Header() {
  return (
    <header 
      className="bg-cover bg-no-repeat bg-center min-h-screen text-white relative" 
      style={{ backgroundImage: `url(${backgroundImage})` }}>

      <div className="container mx-auto px-6 md:px-12 lg:px-24">
        {/* Navigation menu at the top */}
        <nav className="pt-4">
          <div className="flex justify-between items-center">
            <h1 className="text-4xl font-bold">Welcome to Our Sitesss</h1>
            <div className="flex items-center space-x-6">
              <a href="#about" className="hover:text-gray-300">About</a>
              <a href="#features" className="hover:text-gray-300">Features</a>
              {/* Add more navigation links if needed */}
            </div>
          </div>
        </nav>

        {/* Centered content */}
        <div className="flex flex-col items-center justify-center h-full">
          <p className="text-xl md:text-3xl mb-4 max-w-xl text-center">Discover the amazing world of Tailwind CSS</p>
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Get Started
          </button>
        </div>
      </div>
    </header>
  );
}

export default Header;
